import React, { useEffect, useState } from "react";
import domain from "../../../../util/domain";
import Axios from "axios";
import OpenOpinion from "../../global/Opinions/OpenOpinion";

export default function Opinions(props) {
  const [ready, setReady] = useState(false);
  const [res, setRes] = useState();
  const [successMessage, setSuccessMessage] = useState(null);

  useEffect(() => {
    const getMyPeople = async () => {
      const allpeopleres = await Axios.get(`${domain}/user/getmypeople`);
      setRes(allpeopleres.data);
      if (!ready) setReady(true);
    };
    if (!ready) getMyPeople();
  }, []);

  return ready ? (
    <div className="col">
      <h2>רשימת האנשים שלי:</h2>
      {res.map((screw) => (
        <>
          <OpenOpinion suc={setSuccessMessage} shel={screw._id} />
          <br />
        </>
      ))}
    </div>
  ) : (
    <div>
      טוען את כל האנשים שלך מהשרת... (רוב הסיכויים שאם אתה מספיק לקרוא את ההודעה
      הזאת אז יש תקלה בשרת)
    </div>
  );
}
